import React from 'react';
import { useParams } from 'react-router-dom';

const Pages = (props) => {
    console.log(props)
    let { page } = useParams();

    if(page === 'undefined'){ page = 'about' }

    return (
        <div className="container">
            <section className="p-5">
                I am pages component. {page}
            </section>
        </div>
    );
}


export default Pages;
